import * as S from './ExpenseItem.style';

function ExpenseItem(props) {
    const {
        date,
        title,
        amount,
    } = props;
    return (
        <S.ExpenseItem>
            <ExpenseDate />
            <S.ContentWrapper>
            <S.Description>iPhone</S.Description>
            <S.Amount>$ 2000</S.Amount>
            </S.ContentWrapper>
        </S.ExpenseItem>
    );
}

export default ExpenseItem;
